import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import {
  Table, TableBody, TableCell, TableContainer,
  TableHead, TableRow, Paper, Typography
} from "@mui/material";

export default function AccountsList() {
  const [accounts, setAccounts] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    fetch("http://localhost:8000/accounts")
      .then(res => res.json())
      .then(setAccounts);
  }, []);

  return (
    <>
      <Typography variant="h4" gutterBottom>
        Accounts
      </Typography>

      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell><b>Account Name</b></TableCell>
              <TableCell><b>Quoted Cost</b></TableCell>
              <TableCell><b>Onboard Date</b></TableCell>
            </TableRow>
          </TableHead>

          <TableBody>
            {accounts.map(acc => (
              <TableRow
                key={acc.account_id}
                hover
                sx={{ cursor: "pointer" }}
                onClick={() => navigate(`/accounts/${acc.account_id}`)}
              >
                <TableCell>{acc.name}</TableCell>
                <TableCell>${acc.quoted_cost}</TableCell>
                <TableCell>{acc.onboard_date}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </>
  );
}
